id:
A JSON `STRUCTURE` for configuring static website hosting.
	Example:
	{
		"ErrorDocument": {
			"Key": "error.html"
		},
		"IndexDocument": {
			"Suffix": "index.html"
		},
		"RoutingRules": [
			{
				"Condition": {
					...
				},
				"Redirect": {
					...
				}
			}
		]
	}

translation:
静的Webサイトのホスティングを構成するためのJSON「STRUCTURE」。
例:
{
"ErrorDocument": {
			"Key": "error.html"
		},
"IndexDocument": {
			"Suffix": "index.html"
		},
"RoutingRules": [
{
"Condition": {
					...
				},
"Redirect": {
					...
				}
}
]
}

id:
A `STRUCTURE` using JSON syntax in a file.
	Example:
	{
		"CORSRules": [
			{
				"AllowedHeaders": ["*"],
				"AllowedMethods": ["PUT", "GET", "DELETE"],
				"AllowedOrigins": ["http://www.example.com"],
				"ExposeHeaders": ["ExposeHeader7", "ExposeHeader8"],
				"MaxAgeSeconds": 75
			}
		]
	}

translation:
ファイル内のJSON構文を使用した「STRUCTURE」。
例:
{
"CORSRules": [
{
				"AllowedHeaders": ["*"],
				"AllowedMethods": ["PUT", "GET", "DELETE"],
				"AllowedOrigins": ["http://www.example.com"],
				"ExposeHeaders": ["ExposeHeader7", "ExposeHeader8"],
				"MaxAgeSeconds": 75
			}
]
}

